package.descr:
The Reliable, High Performance TCP/HTTP(S) Load Balancer.&lt;br /&gt;
			This package implements the TCP, HTTP and HTTPS balancing features from haproxy.&lt;br /&gt;
			Supports ACLs for smart backend switching.

BandwidthD tracks usage of TCP/IP network subnets and builds html files with graphs to display utilization.&lt;br/&gt;
			Charts are built by individual IPs, and by default display utilization over 2 day, 8 day, 40 day, and 400 day periods. Furthermore, each IP address's utilization can be logged out in CDF format, or to a backend database server.&lt;br/&gt;
			HTTP, TCP, UDP, ICMP, VPN, and P2P traffic are color coded.

pfBlockerNG-devel is the Next Generation of pfBlockerNG.&lt;br /&gt;
			Manage IPv4/v6 List Sources into 'Deny, Permit or Match' formats.&lt;br /&gt;
			GeoIP database by MaxMind Inc. (GeoLite2 Free version).&lt;br /&gt;
			De-Duplication, Suppression, and Reputation enhancements.&lt;br /&gt;
			Provision to download from diverse List formats.&lt;br /&gt;
			Advanced Integration for Proofpoint ET IQRisk IP Reputation Threat Sources.&lt;br /&gt;
			Domain Name (DNSBL) blocking via Unbound DNS Resolver.
